My buddy needed some major engine work done on his truck but was broke, so he traded this package to me in exchange for the work I did. It's an awesome package; I just already have a G20 so I really don't need two 10mm, but this setup would be great for hiking in Black Bear or Cougar country! 

Here's a list of everything in the picture below:
-Glock 29 SF Gen 3 (only 10 rounds through it and I have the other 10 rounds which I'll throw into the deal for free, and it has a custom fine stipple job that's great, plus all of the factory packaging is there including the lock); 
-There are five factory, Gen 3 mags (two 10-rounders and three 15-rounders);
-One ported, extended Lone Wolf barrel (zero rounds through it);
-One OWB Blackhawk! nylon holster.

Make me a cash offer! I'm not looking to get rich off this deal, but I'm also not going to just give it away.
